import React, { Component } from 'react'

export class ShowInfo1 extends Component {
  render() {
    return (
        <div className='full-item'>
            <div onClick={() => this.state.onShowInfo1()}>ShowInfo1</div>
        </div>
    )
  }
}

export default ShowInfo1
